For our example use case, the easiest way to allow the client to trust our server is to disable certificate verification (don't do this in production!). When the rustls dangerous_configuration feature flag is enabled, a client can be configured to trust any server. Start by adding a rustls dependency with the dangerous_configuration feature flag to your Cargo.toml file. quinn = "*"
rustls = { version = "*", features = ["dangerous_configuration", "quic"] } Then, allow the client to skip the certificate validation by implementing ServerCertVerifier and letting it assert verification for any server. // Implementation of `ServerCertVerifier` that verifies everything as trustworthy.
struct SkipCertificationVerification; impl rustls::ServerCertVerifier for SkipCertificationVerification { fn verify_server_cert( &self, _: &rustls::RootCertStore, _: &[rustls::Certificate], _: webpki::DNSNameRef, _: &[u8], ) -> Result<rustls::ServerCertVerified, rustls::TLSError> { Ok(ServerCertVerified::assertion()) }
} After that, modify the ClientConfig to use this ServerCertVerifier implementation. pub fn insecure() -> ClientConfig { let mut cfg = quinn::ClientConfigBuilder::default().build(); // Get a mutable reference to the 'crypto' config in the 'client config'. let tls_cfg: &mut rustls::ClientConfig = std::sync::Arc::get_mut(&mut cfg.crypto).unwrap(); // Change the certification verifier. // This is only available when compiled with the 'dangerous_configuration' feature. tls_cfg .dangerous() .set_certificate_verifier(Arc::new(SkipCertificationVerification)); cfg
} Finally, if you plug this ClientConfig into the EndpointBuilder::default_client_config() your client endpoint should verify all connections as trustworthy.

