Now that you have a valid certificate, the client and server need to be configured to use it. After configuring plug the configuration into the Endpoint. Configure Server let mut builder = ServerConfigBuilder::default();
builder.certificate(CertificateChain::from_certs(vec![certificate]), key)?; This is the only thing you need to do for your server to be secured. Configure Client let mut builder = ClientConfigBuilder::default();
builder.add_certificate_authority(certificate)?; This is the only thing you need to do for your client to trust a server certificate. Next , let's have a look at how to set up a connection.
